- input: "TEXT\x1CC00298000\x1C2014030120140331\x1C\x1CF3XN\x1CAll contributions noted
    as EM indicate a contribution received by Madison Project that was earmarked for
    a specific candidate. The candidate name is noted and the date of transmittal
    to each candidate is noted. The matching transmittal checks are itemized on line
    23. All contributors aggregating over $200 calendar year to date with incomplete
    employer/occupation have received requests for additional information. Per instructions
    from the FEC, the adjusting entry on line 21b balances the IE payments made to
    Madison Project for CC processing fees. All disbursements disclosed on line 21b
    are operating expenses of the committee and are not public communications in support
    of or to oppose any other candidate. All independent expenditures are disclosed
    on line 24.\n"
